import React from 'react'
import './App.css'
import { Switch,Route } from 'react-router-dom';
import Homepage from './pages/Homepage';




function App () {
  return(
    <div>
      <Switch>
        <Route exact path="/"><Homepage /></Route>
    </Switch>
    </div>
  )
}


export default App;
